    <template>
        <div id=\"{{ 'waste_' ~ id }}\">
            #{{ id }} created
        </div>
    </template>
</turbo-stream>
{% endblock %}

{% block update %}
<turbo-stream action=\"update\" target=\"waste_{{ id }}\">
    <template>
        #{{ id }} updated
    </template>
</turbo-stream>
{% endblock %}

